// src/components/ServiceCard.js
import React, { useState, useRef, useEffect } from 'react';

const ServiceCard = ({ service, onOpenModal, isModalOpen, isActiveCard }) => {
  const [isFlipped, setIsFlipped] = useState(false);
  const [isAnimated, setIsAnimated] = useState(false); // For hover/click lift effect
  const cardRef = useRef(null);

  // This is the core logic to reset the card when the modal closes
  useEffect(() => {
    // If the modal is NOT open, and this card WAS the active one, reset it.
    if (!isModalOpen && isFlipped) {
      // Reset classes and styles to return to original state
      cardRef.current.className = 'product-card-leave'; // Use a leaving animation class
      setTimeout(() => {
          if (cardRef.current) {
            cardRef.current.querySelector('#product-front').style.display = 'block';
            cardRef.current.querySelector('#product-back').style.display = 'none';
            setIsFlipped(false);
            setIsAnimated(false);
            cardRef.current.className = '';
          }
      }, 600) // Match the duration of the animation
    }
  }, [isModalOpen, isFlipped]);


  const handleCardClick = () => {
    if (!isFlipped) {
      setIsAnimated(!isAnimated);
    }
  };

  const handleFlip = () => {
    if (!isFlipped) {
      setIsFlipped(true);
      setIsAnimated(true); // Keep it lifted

      // Perform flip animation
      const productCard = cardRef.current;
      productCard.classList.add('flip-10');
      setTimeout(() => productCard.classList.add('flip90'), 150);
      setTimeout(() => {
          if(productCard) productCard.querySelector('#product-front').style.display = 'none';
          productCard.classList.add('flip190');
      }, 300);
      setTimeout(() => productCard.classList.add('flip180'), 450);
      setTimeout(() => {
          if(productCard) {
            productCard.querySelector('#product-back').style.display = 'block';
            productCard.querySelector('#cx').classList.add('s1', 's2', 's3');
            productCard.querySelector('#cy').classList.add('s1', 's2', 's3');
          }
      }, 600);
    }
  };

  return (
    <div 
        id="make-3D-space" 
        onClick={handleCardClick} // Added main click handler
        onMouseEnter={() => !isFlipped && setIsAnimated(true)}
        onMouseLeave={() => !isFlipped && setIsAnimated(false)}
    >
      <div
        id="product-card"
        ref={cardRef}
        className={`${isAnimated ? 'animate' : ''} ${isFlipped ? 'flip180' : ''}`}
      >
        <div id="product-front">
          <div className="shadow"></div>
          <img src={service.image} alt={service.title} />
          <div className="image_overlay"></div>
          <div id="view_details" onClick={(e) => { e.stopPropagation(); handleFlip(); }}>View details</div>
          <div className="stats">
            <div className="stats-container">
              <span className="product_name">{service.summaryTitle}</span>
              <p>{service.summaryDescription}</p>
              <div className="product-options">
                {service.summaryOptions.map((opt, index) => (
                    <div key={index}>
                        <strong>{opt.type}</strong>
                        <span>{opt.details}</span>
                    </div>
                ))}
              </div>
            </div>
          </div>
        </div>
        <div id="product-back" style={{ display: 'none' }}>
          <div className="shadow"></div>
          <div id="flip-back">
            <div id="cy"></div>
            <div id="cx"></div>
          </div>
          <div className="back-content">
              <h2>{service.title}</h2>
              <p>Ready to learn more about how we can make your event unforgettable?</p>
              <button className="view-full-details-btn" onClick={(e) => { e.stopPropagation(); onOpenModal(service); }}>
                View Full Details
              </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ServiceCard;
